import { useState, useEffect } from "react";
import axios from "axios";
import { DragDropContext, Droppable, Draggable } from "react-beautiful-dnd";
import "./priorList.css";

const Prioritylist = () => {
    const [taskData, setTaskData] = useState([]);

    const loadData = () => {
        axios.get("http://localhost:8000/task/Display").then((res) => {
            setTaskData(res.data);
        });
    };

    useEffect(() => {
        loadData();
    }, []);

    const onDragEnd = (result) => {
        // Dropped outside the list
        if (!result.destination) {
            return;
        }

        const items = Array.from(taskData);
        const [reorderedItem] = items.splice(result.source.index, 1);
        items.splice(result.destination.index, 0, reorderedItem);

        setTaskData(items);
    };

    return (
        <DragDropContext onDragEnd={onDragEnd}>
            <div className="priority">
                <Droppable droppableId="tasks">
                    {(provided) => (
                        <div className="prioritybox" ref={provided.innerRef} {...provided.droppableProps}>
                            <h1 style={{ color: "red" }}>High Priority</h1>
                            {taskData.map((task, index) => {
                                if (task.priority === "High") {
                                    return (
                                        <Draggable key={task.id} draggableId={task.id} index={index}>
                                            {(provided) => (
                                                <div
                                                    ref={provided.innerRef}
                                                    {...provided.draggableProps}
                                                    {...provided.dragHandleProps}
                                                    className="task"
                                                >
                                                    <span>{task.title}</span>
                                                    <span>{task.description}</span>
                                                </div>
                                            )}
                                        </Draggable>
                                    );
                                }
                                return null;
                            })}
                            {provided.placeholder}
                        </div>
                    )}
                </Droppable>
                <Droppable droppableId="tasks">
                    {(provided) => (
                        <div className="prioritybox" ref={provided.innerRef} {...provided.droppableProps}>
                            <h1 style={{ color: "orange" }}>Medium Priority</h1>
                            {taskData.map((task, index) => {
                                if (task.priority === "Medium") {
                                    return (
                                        <Draggable key={task.id} draggableId={task.id} index={index}>
                                            {(provided) => (
                                                <div
                                                    ref={provided.innerRef}
                                                    {...provided.draggableProps}
                                                    {...provided.dragHandleProps}
                                                    className="task"
                                                >
                                                    <span>{task.title}</span>
                                                    <span>{task.description}</span>
                                                </div>
                                            )}
                                        </Draggable>
                                    );
                                }
                                return null;
                            })}
                            {provided.placeholder}
                        </div>
                    )}
                </Droppable>
                <Droppable droppableId="tasks">
                    {(provided) => (
                        <div className="prioritybox" ref={provided.innerRef} {...provided.droppableProps}>
                            <h1 style={{ color: "green" }}>Low Priority</h1>
                            {taskData.map((task, index) => {
                                if (task.priority === "Low") {
                                    return (
                                        <Draggable key={task.id} draggableId={task.id} index={index}>
                                            {(provided) => (
                                                <div
                                                    ref={provided.innerRef}
                                                    {...provided.draggableProps}
                                                    {...provided.dragHandleProps}
                                                    className="task"
                                                >
                                                    <span>{task.title}</span>
                                                    <span>{task.description}</span>
                                                </div>
                                            )}
                                        </Draggable>
                                    );
                                }
                                return null;
                            })}
                            {provided.placeholder}
                        </div>
                    )}
                </Droppable>
            </div>
        </DragDropContext>
    );
};

export default Prioritylist;
